[[package]]
name = "astor"
version = "0.8.1"
description = "Read/rewrite/write Python ASTs"
category = "dev"
optional = false
python-versions = "!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,>=2.7"

[[package]]
name = "astpretty"
version = "2.1.0"
description = "Pretty print the output of python stdlib `ast.parse`."
category = "dev"
optional = false
python-versions = ">=3.6.1"

[package.extras]
typed = ["typed-ast"]

[[package]]
name = "atomicwrites"
version = "1.4.0"
description = "Atomic file writes."
category = "dev"
optional = false
python-versions = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*"

[[package]]
name = "attrs"
version = "21.4.0"
description = "Classes Without Boilerplate"
category = "dev"
optional = false
python-versions = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"

[package.extras]
dev = [
 "coverage[toml] (>=5.0.2)",
 "hypothesis",
 "pympler",
 "pytest (>=4.3.0)",
 "six",
 "mypy",
 "pytest-mypy-plugins",
 "zope.interface",
 "furo",
 "sphinx",
 "sphinx-notfound-page",
 "pre-commit",
 "cloudpickle",
]
docs = ["furo", "sphinx", "zope.interface", "sphinx-notfound-page"]
tests = [
 "coverage[toml] (>=5.0.2)",
 "hypothesis",
 "pympler",
 "pytest (>=4.3.0)",
 "six",
 "mypy",
 "pytest-mypy-plugins",
 "zope.interface",
 "cloudpickle",
]
tests_no_zope = [
 "coverage[toml] (>=5.0.2)",
 "hypothesis",
 "pympler",
 "pytest (>=4.3.0)",
 "six",
 "mypy",
 "pytest-mypy-plugins",
 "cloudpickle",
]

[[package]]
name = "aws-lambda-typing"
version = "2.10.1"
description = "A package that provides type hints for AWS Lambda event, context and response objects"
category = "dev"
optional = false
python-versions = ">=3.6,<4.0"

[[package]]
name = "bandit"
version = "1.7.4"
description = "Security oriented static analyser for python code."
category = "dev"
optional = false
python-versions = ">=3.7"

[package.dependencies]
colorama = { version = ">=0.3.9", markers = "platform_system == \"Windows\"" }
GitPython = ">=1.0.1"
PyYAML = ">=5.3.1"
stevedore = ">=1.20.0"

[package.extras]
test = [
 "coverage (>=4.5.4)",
 "fixtures (>=3.0.0)",
 "flake8 (>=4.0.0)",
 "stestr (>=2.5.0)",
 "testscenarios (>=0.5.0)",
 "testtools (>=2.3.0)",
 "toml",
 "beautifulsoup4 (>=4.8.0)",
 "pylint (==1.9.4)",
]
toml = ["toml"]
yaml = ["pyyaml"]

[[package]]
name = "black"
version = "22.3.0"
description = "The uncompromising code formatter."
category = "dev"
optional = false
python-versions = ">=3.6.2"

[package.dependencies]
click = ">=8.0.0"
mypy-extensions = ">=0.4.3"
pathspec = ">=0.9.0"
platformdirs = ">=2"
tomli = { version = ">=1.1.0", markers = "python_version < \"3.11\"" }
typing-extensions = { version = ">=3.10.0.0", markers = "python_version < \"3.10\"" }

[package.extras]
colorama = ["colorama (>=0.4.3)"]
d = ["aiohttp (>=3.7.4)"]
jupyter = ["ipython (>=7.8.0)", "tokenize-rt (>=3.2.0)"]
uvloop = ["uvloop (>=0.15.2)"]

