 "pytest-checkdocs (>=2.4)",
 "pytest-flake8",
 "pytest-cov",
 "pytest-enabler (>=1.0.1)",
 "packaging",
 "pyfakefs",
 "flufl.flake8",
 "pytest-perf (>=0.9.2)",
 "pytest-black (>=0.3.7)",
 "pytest-mypy (>=0.9.1)",
 "importlib-resources (>=1.3)",
]

[[package]]
name = "iniconfig"
version = "1.1.1"
description = "iniconfig: brain-dead simple config-ini parsing"
category = "dev"
optional = false
python-versions = "*"

[[package]]
name = "isort"
version = "5.10.1"
description = "A Python utility / library to sort Python imports."
category = "dev"
optional = false
python-versions = ">=3.6.1,<4.0"

[package.extras]
pipfile_deprecated_finder = ["pipreqs", "requirementslib"]
requirements_deprecated_finder = ["pipreqs", "pip-api"]
colors = ["colorama (>=0.4.3,<0.5.0)"]
plugins = ["setuptools"]

[[package]]
name = "jmespath"
version = "1.0.0"
description = "JSON Matching Expressions"
category = "main"
optional = false
python-versions = ">=3.7"

[[package]]
name = "mccabe"
version = "0.6.1"
description = "McCabe checker, plugin for flake8"
category = "dev"
optional = false
python-versions = "*"

[[package]]
name = "more-itertools"
version = "8.12.0"
description = "More routines for operating on iterables, beyond itertools"
category = "dev"
optional = false
python-versions = ">=3.5"

[[package]]
name = "mr-proper"
version = "0.0.7"
description = "Static Python code analyzer, that tries to check if functions in code are pure or not and why."
category = "dev"
optional = false
python-versions = "*"

[package.dependencies]
click = ">=7.1.2"
stdlib-list = ">=0.5.0"

[[package]]
name = "mypy"
version = "0.942"
description = "Optional static typing for Python"
category = "dev"
optional = false
python-versions = ">=3.6"

[package.dependencies]
mypy-extensions = ">=0.4.3"
tomli = ">=1.1.0"
typing-extensions = ">=3.10"

[package.extras]
dmypy = ["psutil (>=4.0)"]
python2 = ["typed-ast (>=1.4.0,<2)"]
reports = ["lxml"]

